        htmlFor="user-id"
        rules={[{ required: true, message: "Please input username!" }]}
      >
        <Input htmlFor="user-id" value={id} onChange={onChangeId} />
      </Form.Item>
      <Form.Item
        label="Password"
        name="password"
        htmlFor="user-password"
        rules={[{ required: true, message: "Please input password!" }]}
      >
        <Input htmlFor="user-password" type={password} value={password} />
      </Form.Item>
      <Form.Item>
        <Button type="primary" htmlType="submit">
          Submit
        </Button>
      </Form.Item>
    </Form>
  );
}

